    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + - col1 NOT BETWEEN NULL AND + 25 + + ( + col1 ) + - col0 * col1 * + 48;
  - name: tab1

outputs:
  - name: q3387.out
    data: |
      51	14	96
      85	5	59
      91	47	68
